import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import { eel } from './eel.js';

class App extends Component {
	constructor(props) {
		super(props);
		eel.set_host('ws://localhost:8888');
		eel.hello();
	}
	render() {
		return (
			<div className="App">
				<h1> SAE NEW ERA </h1>
			</div>
		);
	}
}

export default App;
